import './Post.css';

function Post(props) {
  const [modalActive, setModalActive] = useState(true);
  const { name, image } = props;

  return (
    <div className="post">
      <Modal active={modalActive} setActive={setModalActive} />
      <img src={image} alt={name} />
      <h2>{name}</h2>
    </div>
  );
}

export default Post;
